webpackJsonp([0xa8aec2ac0626],{3067:function(e,n){e.exports={pathContext:{docHtml:"<h1>kind-of <a href=\"https://www.npmjs.com/package/kind-of\"><img src=\"https://img.shields.io/npm/v/kind-of.svg?style=flat\" alt=\"NPM version\"></a> <a href=\"https://npmjs.org/package/kind-of\"><img src=\"https://img.shields.io/npm/dm/kind-of.svg?style=flat\" alt=\"NPM monthly downloads\"></a> <a href=\"https://npmjs.org/package/kind-of\"><img src=\"https://img.shields.io/npm/dt/kind-of.svg?style=flat\" alt=\"NPM total downloads\"></a> <a href=\"https://travis-ci.org/jonschlinkert/kind-of\"><img src=\"https://img.shields.io/travis/jonschlinkert/kind-of.svg?style=flat&#x26;label=Travis\" alt=\"Linux Build Status\"></a></h1>\n<blockquote>\n<p>Get the native type of a value.</p>\n</blockquote>\n<h2>Install</h2>\n<p>Install with <a href=\"https://www.npmjs.com/\">npm</a>:</p>\n<pre><code class=\"language-sh\">$ npm install --save kind-of\n</code></pre>\n<h2>Install</h2>\n<p>Install with <a href=\"https://bower.io/\">bower</a></p>\n<pre><code class=\"language-sh\">$ bower install kind-of --save\n</code></pre>\n<h2>Usage</h2>\n<blockquote>\n<p>es5, browser and es6 ready</p>\n</blockquote>\n<pre><code class=\"language-js\">var kindOf = require('kind-of');\n\nkindOf(undefined);\n//=> 'undefined'\n\nkindOf(null);\n//=> 'null'\n\nkindOf(true);\n//=> 'boolean'\n\nkindOf(false);\n//=> 'boolean'\n\nkindOf(new Boolean(true));\n//=> 'boolean'\n\nkindOf(new Buffer(''));\n//=> 'buffer'\n\nkindOf(42);\n//=> 'number'\n\nkindOf(new Number(42));\n//=> 'number'\n\nkindOf('str');\n//=> 'string'\n\nkindOf(new String('str'));\n//=> 'string'\n\nkindOf(arguments);\n//=> 'arguments'\n\nkindOf({});\n//=> 'object'\n\nkindOf(Object.create(null));\n//=> 'object'\n\nkindOf(new Test());\n//=> 'object'\n\nkindOf(new Date());\n//=> 'date'\n\nkindOf([]);\n//=> 'array'\n\nkindOf([1, 2, 3]);\n//=> 'array'\n\nkindOf(new Array());\n//=> 'array'\n\nkindOf(/foo/);\n//=> 'regexp'\n\nkindOf(new RegExp('foo'));\n//=> 'regexp'\n\nkindOf(function () {});\n//=> 'function'\n\nkindOf(function * () {});\n//=> 'function'\n\nkindOf(new Function());\n//=> 'function'\n\nkindOf(new Map());\n//=> 'map'\n\nkindOf(new WeakMap());\n//=> 'weakmap'\n\nkindOf(new Set());\n//=> 'set'\n\nkindOf(new WeakSet());\n//=> 'weakset'\n\nkindOf(Symbol('str'));\n//=> 'symbol'\n\nkindOf(new Int8Array());\n//=> 'int8array'\n\nkindOf(new Uint8Array());\n//=> 'uint8array'\n\nkindOf(new Uint8ClampedArray());\n//=> 'uint8clampedarray'\n\nkindOf(new Int16Array());\n//=> 'int16array'\n\nkindOf(new Uint16Array());\n//=> 'uint16array'\n\nkindOf(new Int32Array());\n//=> 'int32array'\n\nkindOf(new Uint32Array());\n//=> 'uint32array'\n\nkindOf(new Float32Array());\n//=> 'float32array'\n\nkindOf(new Float64Array());\n//=> 'float64array'\n</code></pre>\n<h2>Benchmarks</h2>\n<p>Benchmarked against <a href=\"http://github.com/CodingFu/typeof\">typeof</a> and <a href=\"https://github.com/ForbesLindesay/type-of\">type-of</a>.\nNote that performaces is slower for es6 features <code>Map</code>, <code>WeakMap</code>, <code>Set</code> and <code>WeakSet</code>.</p>\n<pre><code class=\"language-bash\">#1: array\n  current x 23,329,397 ops/sec ±0.82% (94 runs sampled)\n  lib-type-of x 4,170,273 ops/sec ±0.55% (94 runs sampled)\n  lib-typeof x 9,686,935 ops/sec ±0.59% (98 runs sampled)\n\n#2: boolean\n  current x 27,197,115 ops/sec ±0.85% (94 runs sampled)\n  lib-type-of x 3,145,791 ops/sec ±0.73% (97 runs sampled)\n  lib-typeof x 9,199,562 ops/sec ±0.44% (99 runs sampled)\n\n#3: date\n  current x 20,190,117 ops/sec ±0.86% (92 runs sampled)\n  lib-type-of x 5,166,970 ops/sec ±0.74% (94 runs sampled)\n  lib-typeof x 9,610,821 ops/sec ±0.50% (96 runs sampled)\n\n#4: function\n  current x 23,855,460 ops/sec ±0.60% (97 runs sampled)\n  lib-type-of x 5,667,740 ops/sec ±0.54% (100 runs sampled)\n  lib-typeof x 10,010,644 ops/sec ±0.44% (100 runs sampled)\n\n#5: null\n  current x 27,061,047 ops/sec ±0.97% (96 runs sampled)\n  lib-type-of x 13,965,573 ops/sec ±0.62% (97 runs sampled)\n  lib-typeof x 8,460,194 ops/sec ±0.61% (97 runs sampled)\n\n#6: number\n  current x 25,075,682 ops/sec ±0.53% (99 runs sampled)\n  lib-type-of x 2,266,405 ops/sec ±0.41% (98 runs sampled)\n  lib-typeof x 9,821,481 ops/sec ±0.45% (99 runs sampled)\n\n#7: object\n  current x 3,348,980 ops/sec ±0.49% (99 runs sampled)\n  lib-type-of x 3,245,138 ops/sec ±0.60% (94 runs sampled)\n  lib-typeof x 9,262,952 ops/sec ±0.59% (99 runs sampled)\n\n#8: regex\n  current x 21,284,827 ops/sec ±0.72% (96 runs sampled)\n  lib-type-of x 4,689,241 ops/sec ±0.43% (100 runs sampled)\n  lib-typeof x 8,957,593 ops/sec ±0.62% (98 runs sampled)\n\n#9: string\n  current x 25,379,234 ops/sec ±0.58% (96 runs sampled)\n  lib-type-of x 3,635,148 ops/sec ±0.76% (93 runs sampled)\n  lib-typeof x 9,494,134 ops/sec ±0.49% (98 runs sampled)\n\n#10: undef\n  current x 27,459,221 ops/sec ±1.01% (93 runs sampled)\n  lib-type-of x 14,360,433 ops/sec ±0.52% (99 runs sampled)\n  lib-typeof x 23,202,868 ops/sec ±0.59% (94 runs sampled)\n</code></pre>\n<h2>Optimizations</h2>\n<p>In 7 out of 8 cases, this library is 2x-10x faster than other top libraries included in the benchmarks. There are a few things that lead to this performance advantage, none of them hard and fast rules, but all of them simple and repeatable in almost any code library:</p>\n<ol>\n<li>Optimize around the fastest and most common use cases first. Of course, this will change from project-to-project, but I took some time to understand how and why <code>typeof</code> checks were being used in my own libraries and other libraries I use a lot.</li>\n<li>Optimize around bottlenecks - In other words, the order in which conditionals are implemented is significant, because each check is only as fast as the failing checks that came before it. Here, the biggest bottleneck by far is checking for plain objects (an object that was created by the <code>Object</code> constructor). I opted to make this check happen by process of elimination rather than brute force up front (e.g. by using something like <code>val.constructor.name</code>), so that every other type check would not be penalized it.</li>\n<li>Don't do uneccessary processing - why do <code>.slice(8, -1).toLowerCase();</code> just to get the word <code>regex</code>? It's much faster to do <code>if (type === '[object RegExp]') return 'regex'</code></li>\n</ol>\n<h2>About</h2>\n<h3>Related projects</h3>\n<ul>\n<li><a href=\"https://www.npmjs.com/package/is-glob\">is-glob</a>: Returns <code>true</code> if the given string looks like a glob pattern or an extglob pattern… <a href=\"https://github.com/jonschlinkert/is-glob\">more</a> | <a href=\"https://github.com/jonschlinkert/is-glob\" title=\"Returns &#x60;true&#x60; if the given string looks like a glob pattern or an extglob pattern. This makes it easy to create code that only uses external modules like node-glob when necessary, resulting in much faster code execution and initialization time, and a bet\">homepage</a></li>\n<li><a href=\"https://www.npmjs.com/package/is-number\">is-number</a>: Returns true if the value is a number. comprehensive tests. | <a href=\"https://github.com/jonschlinkert/is-number\" title=\"Returns true if the value is a number. comprehensive tests.\">homepage</a></li>\n<li><a href=\"https://www.npmjs.com/package/is-primitive\">is-primitive</a>: Returns <code>true</code> if the value is a primitive.  | <a href=\"https://github.com/jonschlinkert/is-primitive\" title=\"Returns &#x60;true&#x60; if the value is a primitive. \">homepage</a></li>\n</ul>\n<h3>Contributing</h3>\n<p>Pull requests and stars are always welcome. For bugs and feature requests, <a href=\"../../issues/new\">please create an issue</a>.</p>\n<h3>Contributors</h3>\n<table>\n<thead>\n<tr>\n<th><strong>Commits</strong></th>\n<th><strong>Contributor</strong></th>\n</tr>\n</thead>\n<tbody>\n<tr>\n<td>59</td>\n<td><a href=\"https://github.com/jonschlinkert\">jonschlinkert</a></td>\n</tr>\n<tr>\n<td>2</td>\n<td><a href=\"https://github.com/miguelmota\">miguelmota</a></td>\n</tr>\n<tr>\n<td>1</td>\n<td><a href=\"https://github.com/dtothefp\">dtothefp</a></td>\n</tr>\n<tr>\n<td>1</td>\n<td><a href=\"https://github.com/ksheedlo\">ksheedlo</a></td>\n</tr>\n<tr>\n<td>1</td>\n<td><a href=\"https://github.com/pdehaan\">pdehaan</a></td>\n</tr>\n<tr>\n<td>1</td>\n<td><a href=\"https://github.com/laggingreflex\">laggingreflex</a></td>\n</tr>\n</tbody>\n</table>\n<h3>Building docs</h3>\n<p><em>(This project's readme.md is generated by <a href=\"https://github.com/verbose/verb-generate-readme\">verb</a>, please don't edit the readme directly. Any changes to the readme must be made in the <a href=\".verb.html\">.verb.md</a> readme template.)</em></p>\n<p>To generate the readme, run the following command:</p>\n<pre><code class=\"language-sh\">$ npm install -g verbose/verb#dev verb-generate-readme &#x26;&#x26; verb\n</code></pre>\n<h3>Running tests</h3>\n<p>Running and reviewing unit tests is a great way to get familiarized with a library and its API. You can install dependencies and run tests with the following command:</p>\n<pre><code class=\"language-sh\">$ npm install &#x26;&#x26; npm test\n</code></pre>\n<h3>Author</h3>\n<p><strong>Jon Schlinkert</strong></p>\n<ul>\n<li><a href=\"https://github.com/jonschlinkert\">github/jonschlinkert</a></li>\n<li><a href=\"https://twitter.com/jonschlinkert\">twitter/jonschlinkert</a></li>\n</ul>\n<h3>License</h3>\n<p>Copyright © 2017, <a href=\"https://github.com/jonschlinkert\">Jon Schlinkert</a>.\nReleased under the <a href=\"LICENSE\">MIT License</a>.</p>\n<hr>\n<p><em>This file was generated by <a href=\"https://github.com/verbose/verb-generate-readme\">verb-generate-readme</a>, v0.6.0, on May 16, 2017.</em></p>",docPath:"argo-ci/node_modules/randomatic/node_modules/is-number/node_modules/kind-of/readme",proj:"argo-ci"}}}});
